import './Display.css'
import { useEffect, useState } from 'react'

function Display() {
  const { data, setData } = useState(null);
  useEffect(() => {
    fetch("https://fakestoreapi.com/products/1")
      .then((resp) => resp.json())
      .then((resp) => {
        setData(resp.message);
      });
  }, []);

  return  (
    <div className="boxes">
            <p>{data}</p>
              <br />
          </div>
        )
    }

  export default Display
